const trigger_names = {}

function init() {
    const chat_summary_elements = document.querySelectorAll('div[role=list] div[role=list] span[role=listitem]');
    if (!chat_summary_elements.length) return;

    console.info('Found a frame!')
    const div = document.createElement('div')
    const h1 = document.createElement('h3')
    h1.innerText = 'Alarms'
    const before = document.querySelector('c-wiz[data-node-index=\'1;0\']')

    div.style.display = 'flex';
    div.style.flexDirection = 'column';
    div.style.gap = '0.5em'
    div.style.padding = '1em'
    div.style.fontFamily = 'system-ui, monospace'

    div.append(h1);

    for (const name of getAllNames()) {
        const button = document.createElement('button');
        button.innerText = name;
        button.onclick = e => {
            if (trigger_names[name]) {
                // turn off the alarm
                trigger_names[name] = false;
                button.style.background = 'transparent'
            }
            else {
                // turn on the alarme
                trigger_names[name] = true;
                button.style.background = 'red';
            }
        }

        div.append(button);
    }

    before.before(div)

    setInterval(check, 1000)
}

setTimeout(init, 1000);

function check() {
    const chat_summary_elements = document.querySelectorAll('div[role=list] div[role=list] span[role=listitem]');

    for (const se of chat_summary_elements) {
        const name_el = se.querySelector('span[role=presentation][data-name]')
        const name = name_el.dataset.name;
        const notif_detector = se.querySelector('div[role=presentation] > span[aria-hidden=true]')
        const dimensions = notif_detector.getBoundingClientRect()
        const exists = dimensions.width > 0 && dimensions.height > 0;

        if (exists && trigger_names[name]) {
            playSound();
            return;
        }
    }
}

function* getAllNames() {
    const chat_summary_elements = document.querySelectorAll('div[role=list] div[role=list] span[role=listitem]');

    for (const se of chat_summary_elements) {
        const name_el = se.querySelector('span[role=presentation][data-name]')
        yield name_el.dataset.name;
    }
}


async function playSound() {
    const audio = new Audio('data:audio/mp3;base64,');
    audio.play();
}
